    false,nt"url": null,nt"notes": "Provides U.S. Federal Spending by agency.
    The Contracts section allows searching for data relating to all Federal contracts.
    There are three main categories of searches: by contractor, by location, and by
    contracting agency. The Purchase section allows users to view purchase cards spending
    of various federal agencies for each fiscal year. The data available on this website
    are extracted from the report published once every quarter on the GSA SmartPay website.
    The GSA SmartPay receives this data directly from the banks that issued the purchase
    cards. This tool allows you to structure your search for data contained on USAspending.gov
